import {INIT_STORE_ACTION, SET_USER_INFO_ACTION} from "../Constants";

export function storeReducers(state,action){
    switch(action.type){
        case SET_USER_INFO_ACTION:{
            const _store = Object.assign({},state);
            _store.userInfo = action.data
            return _store
        }
        case INIT_STORE_ACTION:{
            const _store = {...action.data}
            return _store
        }

    }
}
